n = int(input())
flights = []
for _ in range(n - 1):
    a, b = map(int, input().split())
    flights.append((a, b))

best_change = n
best_flight_to_cancel = None
best_new_flight = None

for a in range(1, n + 1):
    for b in range(1, n + 1):
        if a == b:
            continue

        new_flights = flights.copy()
        for c in range(1, n + 1):
            if c == a or c == b:
                continue

            new_flights.append((c, a) if c < a else (a, c))
            new_flights.append((c, b) if c < b else (b, c))

        change = 0
        visited = set()
        for c in range(1, n + 1):
            if c == a or c == b:
                continue

            for d in range(1, n + 1):
                if d == c or d == a or d == b:
                    continue

                path = (c, d) if c < d else (d, c)
                if path not in visited:
                    change += 1
                    visited.add(path)

        if change < best_change:
            best_change = change
            best_flight_to_cancel = a, b
            best_new_flight = a, b
        elif change == best_change:
            if (a, b) < best_flight_to_cancel:
                best_flight_to_cancel = a, b
            if (a, b) < best_new_flight:
                best_new_flight = a, b

